import React, { Component, useEffect } from 'react';
import { Redirect, Route, Switch, withRouter } from 'react-router-dom';
import { isSignedInSettingsState } from 'state/state';

import routerService from "screens/authed/main/Router/nonAuthIndex";

import { useHistory } from "react-router-dom";
import WebHomeHeader from 'components/WebHomeHeader';


const NonAuthRoute = (props)=> {
    const { match } = props;
    // const isLoginSettings = isSignedInSettingsState.use()
    // const { location } = props;
    //   const history = useHistory();
    
    // useEffect(() => {
    //    if (!location.pathname.includes("/authed") || location.pathname.includes("/authed") && isLoginSettings === false) {
    //        history.push("/pos");
    // }
    // }, [])
    

    return (
            <>
            {/* <WebHomeHeader /> */}
            <Switch>
 {routerService &&
              routerService.map((route, key) => (
                <Route
                  key={key}
                  path={`${match.url}/${route.path}`}
                  component={route.component}
                />
              ))}
            </Switch>
            </>
        )
}

export default withRouter(NonAuthRoute)
